import Grid from "@mui/material/Grid";
import HomePage from "./HomePage";

function Other() {
  return (
    <div>
      <Grid
        container
        alignItems="stretch"
        justifyContent="space-between"
      >
        <Grid item xs={6} className="item">
          <Dropdown />
        </Grid>
        <Grid item xs={6} className="item">
            <p>"ehrdd"</p>
        </Grid>
      </Grid>
    </div>
  );
}

export default Other;
